import React from "react";
import styled from "styled-components";
import Header from "../components/header/Header";
import BodyLayout from "../components/body/BodyLayout";
import Footer from "../components/footer/Footer";
import ImageSlider from "../components/body/imageSlider/ImageSlider";
import { YellowD } from "../components/body/mixin/Mixin";

const MenuSection = styled.section`
  width: 60vw;
  height: 80vh;
  margin: var(--margin-default);
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
`;

const Container = styled.div`
  width: 40%;
  min-width: 360px;
  height: 40%;
  margin: var(--margin-default);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background-color: var(--color-lightpink);
  border-radius: 8px;
`;

const SubHeading = styled.div`
  font-size: var(--font-size-title-normal);
`;

const Article = styled.article`
  width: 100%;
  height: 80%;
  padding: var(--padding-default);
  font-size: var(--font-size-normal);
  border: 2px solid red;
`;

const MemberHome = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        <ImageSlider />
        <MenuSection>
          <Container>
            <SubHeading>
              <YellowD>D</YellowD>+ 36,500
            </SubHeading>
            <Article>
              <div>36,600 기념일 D-100 (2031/12/12)</div>
              <div>101주년 D-365 (2032/09/25)</div>
            </Article>
          </Container>
          <Container>
            <i className="far fa-calendar-alt"></i>
          </Container>
          <Container>next</Container>
          <Container>reviews</Container>
        </MenuSection>
      </BodyLayout>
      <Footer />
    </>
  );
};

export default MemberHome;
